import React from "react";
import "../App.css";

function Login() {
  return (
    <div className="align-items-center d-flex">
      <div className="bg-dark border rounded align-items-center container-fluid d-flex">
        <h1>Enter your login credentials</h1>
      </div>
    </div>
  );
}

export default Login;
